myApp.controller("suaInfoCompanyController",["$scope","$http","$window","$location","$filter","Url",function(n,t,i){n.infoCompany={};n.chooseImage=function(){var t=new CKFinder;t.selectActionFunction=function(t){n.infoCompany.image=t;n.$apply()};t.SelectFunction="ShowFileInfo";t.popup()};n.currentIdinfoCompany=1;n.currentIdinfoCompany&&t.get("/API/infoCompanyAPI/"+n.currentIdinfoCompany).success(function(t){n.infoCompany={id:t.id,tenCTy:t.tenCTy,diaChi:t.diaChi,mail:t.mail,sdt:t.sdt,sdtBan:t.sdtBan,sdtDD:t.sdtDD,image:t.image,fb:t.fb,googlePlus:t.googlePlus,youtube:t.youtube,twitter:t.twitter}});n.saveinfoCompany=function(){n.currentIdinfoCompany?t.put("/API/infoCompanyAPI/"+n.infoCompany.id,n.infoCompany).success(function(){toastr.success("Thành công","Lưu thông tin công ty")}).error(function(){toastr.error("Thất bại","Thêm thông tin công ty")}):t.post("/API/infoCompanyAPI/",n.infoCompany).success(function(){toastr.success("Thành công","Thêm thông tin công ty");i.location.href="/Admin/infoCompanys"}).error(function(){toastr.error("Thất bại","Thêm thông tin công ty")})};n.saveinfoCompanyAndExit=function(){n.currentIdinfoCompany?t.put("/API/infoCompanyAPI/"+n.infoCompany.id,n.infoCompany).success(function(){i.location.href="/Admin/infoCompanys"}).error(function(){toastr.error("Thất bại","Lưu thông tin công ty")}):t.post("/API/infoCompanyAPI/",n.infoCompany).success(function(){i.location.href="/Admin/infoCompanys"}).error(function(){toastr.error("Thất bại","Thêm thông tin công ty")})};n.saveinfoCompanyAndNew=function(){n.currentIdinfoCompany?t.put("/API/infoCompanyAPI/"+n.infoCompany.id,n.infoCompany).success(function(){i.location.href="/Admin/infoCompanys/Create"}).error(function(){toastr.error("Thất bại","Lưu thông tin công ty")}):t.post("/API/infoCompanysAPI/",n.infoCompany).success(function(){i.location.href="/Admin/infoCompanys/Create"}).error(function(){toastr.error("Thất bại","Thêm thông tin công ty")})};n.cancel=function(){i.location.href="/Admin"}}]);